import React, { Component } from 'react';
import styles from './Slider.module.css';

class Slider extends Component {
  constructor(props) {
    super(props);
    this.state = {
      src: 'https://www.southernliving.com/thmb/ZuS1MlY7N7G67Lyvl2zDIoktRDU=/750x0/filters:no_upscale():max_bytes(150000):strip_icc():format(webp)/gettyimages-837898820-1-4deae142d4d0403dbb6cb542bfc56934.jpg',
    };
  }

  render() {
    const { src } = this.state;

    return (
      <article>
        <img className={styles.pic} src={src} alt='' />
      </article>
    );
  }
}

export default Slider;
